import React, { Component } from "react";

class Website extends Component.React {
  render() {
    return (
      <header>
        <nav>
          <div></div>
          <div>
            <a href="/">logo</a>
          </div>
          <div>
            <ul>
              <li>
                <a href="/">Home</a>
              </li>
              <li>
                <a href="/">About</a>
              </li>
              <li>
                <a href="/">Contact</a>
              </li>
            </ul>
          </div>
        </nav>
      </header>
    );
  }
}
export default Website;
